import React from 'react';
import Base from '../core/Base';

const Signin = () => {

    const SigninForm = () => (
        <div className="container">
            <div className="container text-center">
                <h1 className="text-muted">Sign In</h1>
            </div>
        </div>
    );
    return (
        <Base>
            {SigninForm()}
        </Base >)
}
export default Signin;
